DROP TABLE IF EXISTS `f_basecode`;
CREATE TABLE `f_basecode` (
  `codetype` varchar(40) NOT NULL,
  `codeid` varchar(40) NOT NULL,
  `codename` varchar(200) NOT NULL,
  `codename1` varchar(200) DEFAULT NULL,
  `pinyincode` varchar(40) DEFAULT NULL COMMENT '可以设置自定码',
  `parentcodeid` varchar(40) DEFAULT NULL,
  `color` varchar(20) DEFAULT NULL,
  `isvalid` char(1) NOT NULL COMMENT '0- 否 1-是',
  `custom1` varchar(100) DEFAULT NULL,
  `custom2` varchar(100) DEFAULT NULL,
  `custom3` varchar(100) DEFAULT NULL,
  `custom4` varchar(100) DEFAULT NULL,
  `custom5` varchar(100) DEFAULT NULL,
  `custom6` decimal(10,2) DEFAULT NULL,
  `custom7` decimal(10,2) DEFAULT NULL,
  PRIMARY KEY (`codetype`,`codeid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='InnoDB free: 13312 kB; (`codetype`) REFER `shipemp/f_basecod';

