  `id` varchar(40) NOT NULL,
  `interfacetype` varchar(100) DEFAULT NULL COMMENT '如船岸emp接口：shipland',
  `interfacename` varchar(100) DEFAULT NULL COMMENT '比如: organizationservice 类',
  `interfacemethod` varchar(100) DEFAULT NULL COMMENT '比如: updatelandorganization 方法',
  `interfacedesc` varchar(200) DEFAULT NULL COMMENT '同步内部组织',
  `transtime` datetime DEFAULT NULL COMMENT '调用时间',
  `issuccess` varchar(2) DEFAULT NULL COMMENT '0-否 1-是',
  `remark` text COMMENT '如果失败，记录失败信息。',
  `custom1` varchar(100) DEFAULT NULL,
  `custom2` varchar(100) DEFAULT NULL,
  `custom3` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

#
# Data for table "f_datatranslog"
#


#
# Structure for table "f_dict"
#

DROP TABLE IF EXISTS `f_dict`;
CREATE TABLE `f_dict` (
  `id` varchar(64) NOT NULL COMMENT '编号',
  `value` varchar(100) NOT NULL COMMENT '数据值',
  `label` varchar(100) NOT NULL COMMENT '标签名',
  `type` varchar(100) NOT NULL COMMENT '类型',
  `description` varchar(100) NOT NULL COMMENT '描述',
  `sort` decimal(10,0) NOT NULL COMMENT '排序（升序）',
  `parent_id` varchar(64) DEFAULT '0' COMMENT '父级编号',
  `create_by` varchar(64) NOT NULL COMMENT '创建者',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `update_by` varchar(64) NOT NULL COMMENT '更新者',
  `update_date` datetime NOT NULL COMMENT '更新时间',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注信息',
  `del_flag` char(1) NOT NULL DEFAULT '0' COMMENT '删除标记',
  PRIMARY KEY (`id`),
  KEY `sys_dict_value` (`value`) USING BTREE,
  KEY `sys_dict_label` (`label`) USING BTREE,
  KEY `sys_dict_del_flag` (`del_flag`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='字典表';

