DROP TABLE IF EXISTS `f_personnel`;
CREATE TABLE `f_personnel` (
  `personnelid` varchar(40) NOT NULL COMMENT '人员ID',
  `personnelcode` varchar(40) NOT NULL COMMENT '人员编号',
  `personnelname` varchar(40) NOT NULL COMMENT '人员姓名',
  `departmentid` varchar(40) DEFAULT NULL COMMENT '对应组织orgid',
  `companyid` varchar(40) DEFAULT NULL COMMENT '所在公司id',
  `position` varchar(100) DEFAULT NULL COMMENT '职位',
  `sex` varchar(2) DEFAULT NULL COMMENT 'v_sex',
  `birthdate` date DEFAULT NULL COMMENT '出身日期',
  `workdate` date DEFAULT NULL COMMENT '参加工作日期',
  `firstprofessional` varchar(200) DEFAULT NULL COMMENT '第一专业',
  `firsteducation` varchar(200) DEFAULT NULL COMMENT '第一学历',
  `firstcollage` varchar(200) DEFAULT NULL COMMENT '第一院校',
  `education` varchar(200) DEFAULT NULL COMMENT '最终学历',
  `degree` varchar(200) DEFAULT NULL COMMENT '最终学位',
  `professional` varchar(200) DEFAULT NULL COMMENT '最终专业',
  `collage` varchar(200) DEFAULT NULL COMMENT '毕业院校',
  `maritalstatus` varchar(2) DEFAULT NULL COMMENT 'v_maritalstatus 00-未婚 01-已婚 ',
  `idcode` varchar(20) DEFAULT NULL COMMENT '身份证号',
  `insurcode` varchar(40) DEFAULT NULL COMMENT '社会保障号',
  `homeaddress` varchar(200) DEFAULT NULL COMMENT '家庭住址',
  `postalcode` varchar(6) DEFAULT NULL COMMENT '邮政编码',
  `officetel` varchar(20) DEFAULT NULL COMMENT '办公电话',
  `mobile` varchar(20) DEFAULT NULL COMMENT '手机',
  `email` varchar(100) DEFAULT NULL COMMENT '电子邮件',
  `politicalface` varchar(2) DEFAULT NULL COMMENT 'v_politicalface 00-群众 01-党员',
  `joindate` date DEFAULT NULL COMMENT '加入组织时间',
