# Structure for table "f_systemrole"
#

DROP TABLE IF EXISTS `f_systemrole`;
CREATE TABLE `f_systemrole` (
  `roleid` varchar(40) NOT NULL COMMENT '自动生成',
  `rolecode` varchar(40) DEFAULT NULL,
  `rolename` varchar(40) NOT NULL COMMENT '\r\n            ',
  `companyid` varchar(40) DEFAULT NULL,
  `roledescription` text,
  `isvalid` char(1) NOT NULL COMMENT '0- 否 1-是',
  `creater` varchar(20) NOT NULL,
  `createdate` datetime NOT NULL,
  `lastmodifier` varchar(20) DEFAULT NULL,
  `lastmodifydate` datetime DEFAULT NULL COMMENT '主数据变动的时间戳',
  `custom1` varchar(100) DEFAULT NULL,
  `custom2` varchar(100) DEFAULT NULL,
  `custom3` varchar(100) DEFAULT NULL,
  `custom4` varchar(100) DEFAULT NULL,
  `custom5` varchar(100) DEFAULT NULL,
  `custom6` decimal(10,2) DEFAULT NULL,
  `custom7` decimal(10,2) DEFAULT NULL,
  PRIMARY KEY (`roleid`),
  KEY `fk_f_systemrole_f_company_1` (`companyid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='定义系统用户的角色。\r\n\r\n; InnoDB free: 13312 kB; (`companyid`) REFER `';

