DROP TABLE IF EXISTS `f_systemuser`;
CREATE TABLE `f_systemuser` (
  `userid` varchar(40) NOT NULL,
  `usercode` varchar(40) DEFAULT NULL,
  `username` varchar(40) NOT NULL,
  `password` varchar(100) DEFAULT NULL,
  `passwordlevel` varchar(2) DEFAULT NULL COMMENT 'v_passwordlevel',
  `alterdate` datetime DEFAULT NULL COMMENT '密码变更时间',
  `islongvalid` varchar(1) NOT NULL COMMENT '1-是  0-否',
  `alertperiod` int(11) DEFAULT NULL COMMENT '缺省单位为天',
  `startvailddate` datetime DEFAULT NULL COMMENT '用户生效时间',
  `outvailddate` datetime DEFAULT NULL COMMENT '用户失效时间',
  `loginauthtype` varchar(2) DEFAULT NULL COMMENT 'v_loginauthtype',
  `personnelid` varchar(40) DEFAULT NULL,
  `companyid` varchar(40) NOT NULL COMMENT '外部用户：为空 ；内部用户：从职员信息表中获取',
  `isvalid` char(1) NOT NULL COMMENT '0- 否 1-是',
  `islocked` char(1) DEFAULT NULL COMMENT '0-否  1-是   是否锁定，表示临时锁住用户，用户不能登录系统',
  `creater` varchar(20) NOT NULL,
  `createdate` datetime NOT NULL,
  `lastmodifier` varchar(20) DEFAULT NULL,
  `lastmodifydate` datetime DEFAULT NULL COMMENT '主数据变动的时间戳',
  `resolution` varchar(100) DEFAULT NULL COMMENT '分辨率',
  `isshowbg` varchar(10) DEFAULT NULL COMMENT '是否显示背景',
  `bgsrc` varchar(200) DEFAULT NULL COMMENT '背景图片地址',
  `custom1` varchar(100) DEFAULT NULL COMMENT '分辨率',
  `custom2` varchar(100) DEFAULT NULL COMMENT '是否显示背景',
  `custom3` varchar(100) DEFAULT NULL COMMENT '背景图片地址',
  `custom4` varchar(100) DEFAULT NULL,
  `custom5` varchar(100) DEFAULT NULL,
  `custom6` decimal(10,2) DEFAULT NULL,
  `custom7` decimal(10,2) DEFAULT NULL,
  PRIMARY KEY (`userid`),
  KEY `fk_f_systemuser_f_company_1` (`companyid`) USING BTREE,
  KEY `fk_f_systemuser_f_personnel_1` (`personnelid`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='定义使用系统的用户。\r\n\r\n; InnoDB free: 13312 kB; (`companyid`) REFER `';

