DROP TABLE IF EXISTS `hnu_device`;
CREATE TABLE `hnu_device` (
  `id` varchar(64) NOT NULL DEFAULT '' COMMENT '主键',
  `create_by` varchar(64) DEFAULT NULL COMMENT '创建者',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT NULL COMMENT '更新者',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注信息',
  `del_flag` varchar(64) DEFAULT NULL COMMENT '逻辑删除标记（0：显示；1：隐藏）',
  `parent_id` varchar(64) DEFAULT NULL COMMENT '父级编号',
  `parent_ids` varchar(2000) DEFAULT NULL COMMENT '所有父级编号',
  `name` varchar(100) DEFAULT NULL COMMENT '名称',
  `sort` decimal(10,0) DEFAULT NULL COMMENT '排序',
  `dept_id` varchar(64) DEFAULT NULL COMMENT '机构名称',
  `area_id` varchar(64) DEFAULT NULL COMMENT '区域',
  `address` varchar(64) DEFAULT NULL COMMENT '地址',
  `level` int(11) DEFAULT NULL COMMENT '树级别',
  `cat` int(11) DEFAULT NULL COMMENT '类别',
  `device_no` varchar(64) DEFAULT NULL COMMENT '编号',
  `enable` int(11) DEFAULT NULL COMMENT '是否有效',
  `longitude` double DEFAULT NULL COMMENT '经度',
  `latitude` double DEFAULT NULL COMMENT '纬度',
  `code` varchar(8) DEFAULT NULL,
  `ratio` varchar(8) DEFAULT NULL,
  `ip` varchar(64) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='配电室及设备根结点为配电室，子节点为该配';

